import React from 'react';
import Header from './components/Header';

function App() {
  return (
    <div>
    <Header />
    <Switch>
          <Route exact path="/" component={ Login } />
          <Route path="/carteira" component={ Wallet } />
        </Switch>
        </div>
  );
}

export default App;
